import React from 'react'
import Slide from "react-slick"

function Subheader() {
    const settings = {
        dots: true,
        pauseOnFocus:true,
        infinite: true,
        arrows:false,
        speed: 400,
        slidesToShow: 3,
        autoplay:true,
        slidesToScroll: 1
      };
    
    const companys = [
        {
            name:"LC WAİKİKİ",
            img:"ssss"
        },
        {
            name:"KİNETİX",
            img:"aaaaa"
        }
    ]
    return (
        <div className="container justify-between mx-auto w-full flex mt-20 items-center "> 
           <Slide {...settings}>{companys.map((data)=>{
                return(<div className=" p-3 mx-auto shadow-sm w-60 h-60 text-black">
                <div></div>
                <p>{data.name}</p>
                </div>)
            })}</Slide> 
        </div>
    )
}

export default Subheader
